uid: microsoft.quantum.math.iscoprimei
name: IsCoprimeI
type: function
namespace: microsoft.quantum.math
summary: Vrátí hodnotu true, pokud $a $ a $b $ jsou souběžné a false v opačném případě.
syntax: 'function IsCoprimeI (a : Int, b : Int) : Bool'
input:
  content: '(a : Int, b : Int)'
  types:
  - name: a
    summary: první počet primality, které se testují společně
    isPrimitive: true
    uid: Int
  - name: b
    summary: druhý počet, který provádí testování primality
    isPrimitive: true
    uid: Int
output:
  content: Bool
  types:
  - summary: True, pokud $a $ a $b $ jsou souběžné (například jejich největší společný dělitel je 1) a jinak false
    isPrimitive: true
    uid: Bool
